const Cart = ({cart}) => {
    return (
        <div id="shopping-cart">
            <div className="name_cart">Mi carrito</div>
            {
                
                () => {
                    if (cart.length == 0)
                        <div>El carrito está vacío</div>
                    else
                        cart.map( e => console.log(e) )
                }
                
            }
        </div>
    )
}

export default Cart;
